import './App.css';
import { Route } from 'react-router-dom';
import Home from './pages/Home';
import Cart from './pages/Cart';

function App() {
  return (
    <div className="App">
      <Route path='/' exact>
        <Home />
      </Route>
      <Route path='/' exact>
        <Cart />
      </Route>
      <Route path='/' exact>
        <Add />
      </Route>
    </div>
  );
}

export default App;
